import React from 'react'
import { getMovieList } from '../api'

function Home() {
    const [movieList, setMovieList] = useState([])

    const fetch = async () => {
        const result = await getMovieList();
        setMovieList(result)
    }
    fetch();
    
    return (
        <div>
            하이
        </div>
    )
}

export default Home;
